import 'package:flutter/material.dart';
import 'package:flutter_riverpod/flutter_riverpod.dart';
import 'package:supabase_flutter/supabase_flutter.dart';

class TestScreen extends ConsumerStatefulWidget {
  const TestScreen({super.key});
  @override
  ConsumerState<TestScreen> createState() => _TestScreenState();
}

class _TestScreenState extends ConsumerState<TestScreen> {
  final _controller = TextEditingController();
  String? _reply;
  bool _loading = false;

  Future<void> _sendPrompt() async {
    final prompt = _controller.text.trim();
    if (prompt.isEmpty) return;

    setState(() {
      _loading = true;
      _reply = null;
    });

    // 1) 클라이언트에서 보낼 OpenAI 요청 페이로드를 Map으로 정의
    const openAiPayload = test;

    try {
      // final resp = await ref.read(usec)
      // 2) invoke로 Edge Function 호출
      final res = await Supabase.instance.client.functions.invoke(
        'clever-handler', // 배포한 함수 이름
        body: openAiPayload, // 위에서 정의한 페이로드 전체
      );

      if (res.status != 200) {
        throw res.data;
      }
      print(res.data);

      // 3) 응답 파싱 (Chat Completions 스펙)
      final data = res.data as Map<String, dynamic>;
      final id = data['id'] as String;
      final status = data['status'] as String;
      final instructions = data['instructions'] as String;
      final output = data['output'] as List<Map<String, dynamic>>;
      final outputStatus = output[0]['status'] as String;
      final content = output[0]['content'] as List<Map<String, dynamic>>;
      final text = content[0]['text'] as String;

      // 3) 출력
      print('--- Response Debug ---');
      print('id           : $id');
      print('status       : $status');
      print('instructions : $instructions');
      print('outputStatus : $outputStatus');
      print('text         : $text');
      print('----------------------');

      setState(() {
        _reply = text;
      });
    } catch (e) {
      print("error : $e");
      setState(() {
        _reply = 'Error: $e';
      });
    } finally {
      setState(() {
        _loading = false;
      });
    }
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: const Text('Edge Fn + OpenAI 예제')),
      body: Padding(
        padding: const EdgeInsets.all(16),
        child: Column(
          children: [
            Expanded(
              child: SingleChildScrollView(
                child: Text(
                  _loading ? '대기 중…' : (_reply ?? '메시지를 입력하고 전송 버튼을 눌러주세요.'),
                  style: const TextStyle(fontSize: 16),
                ),
              ),
            ),
            TextField(
              controller: _controller,
              decoration: const InputDecoration(
                hintText: '질문을 입력하세요',
                border: OutlineInputBorder(),
              ),
            ),
            const SizedBox(height: 8),
            ElevatedButton(
              onPressed: _loading ? null : _sendPrompt,
              child: const Text('전송'),
            ),
          ],
        ),
      ),
    );
  }
}

const test = {
  "model": "gpt-4.1",
  "input": [
    {
      "role": "user",
      "content": [
        {"type": "input_text", "text": "이미지 관련해서 알려줘"},
        {
          "type": "input_image",
          "image_url":
              "data:image/png;base64,"
        }
      ]
    }
  ],
  "instructions":
      "해당 영어 지문을 1. 해당 문제 해석, 2. 문제 정답, 3. 문제 정답에 관한 해설 순으로 깔끔하게 정리해서 알려줘",
  "previous_response_id":
      "resp_68145058bec08192846820784d833be50961d878d81fe63f"
};
